CREATE FUNCTION public.control_balance_y_estado() RETURNS trigger
    LANGUAGE plpgsql
    AS $$
DECLARE
    total_pagos_completados NUMERIC(10,2);
BEGIN
    -- ============================
    -- 2.1 Proteger balance y estado de modificaciones manuales
    -- ============================
    IF TG_OP = 'UPDATE' THEN
        IF NEW.balance_restante IS DISTINCT FROM OLD.balance_restante THEN
            RAISE EXCEPTION 'No se puede modificar manualmente balance_restante. Es calculado automáticamente.';
        END IF;

        IF NEW.estado_factura_id IS DISTINCT FROM OLD.estado_factura_id THEN
            RAISE EXCEPTION 'No se puede modificar manualmente estado_factura_id. Es calculado automáticamente.';
        END IF;
    END IF;

    -- ============================
    -- 2.2 INSERT: impedir que usuario inserte balance o estado manualmente
    -- ============================
    IF TG_OP = 'INSERT' THEN
        IF NEW.balance_restante IS NOT NULL THEN
            RAISE EXCEPTION 'No se puede asignar balance_restante al crear la factura. Se calcula automáticamente.';
        END IF;

        IF NEW.estado_factura_id IS NOT NULL THEN
            RAISE EXCEPTION 'No se puede asignar estado_factura_id al crear la factura. Se calcula automáticamente.';
        END IF;

        -- Inicializar balance_restante y estado
        NEW.balance_restante := NEW.monto_total;
        NEW.estado_factura_id := (SELECT id FROM estados_factura WHERE nombre='Pendiente');
    END IF;

    -- ============================
    -- 2.3 Calcular balance y estado según pagos completados
    -- ============================
    IF TG_OP = 'INSERT' OR TG_OP = 'UPDATE' THEN
        -- Solo si la fila es de facturas (NEW.id) o pagos asociados
        -- Obtenemos la factura correspondiente
        DECLARE factura_id INT;
        BEGIN
            IF TG_TABLE_NAME = 'pagos' THEN
                factura_id := NEW.factura_id;
            ELSE
                factura_id := NEW.id;
            END IF;

            -- Calcular suma de pagos completados
            SELECT COALESCE(SUM(monto),0)
            INTO total_pagos_completados
            FROM pagos
            WHERE factura_id = factura_id
              AND estado_pago_id = (SELECT id FROM estados_pago WHERE nombre='Completado');

            -- Actualizar balance_restante
            UPDATE facturas
            SET balance_restante = monto_total - total_pagos_completados,
                estado_factura_id =
                    CASE
                        WHEN monto_total - total_pagos_completados = monto_total THEN
                            (SELECT id FROM estados_factura WHERE nombre='Pendiente')
                        WHEN monto_total - total_pagos_completados = 0 THEN
                            (SELECT id FROM estados_factura WHERE nombre='Pagado')
                        ELSE
                            (SELECT id FROM estados_factura WHERE nombre='En Proceso')
                    END
            WHERE id = factura_id;
        END;
    END IF;

    RETURN NEW;
END;
$$;


