CREATE FUNCTION public.trigger_factura_recalculo() RETURNS trigger
    LANGUAGE plpgsql
    AS $$
DECLARE
    fid INT := NEW.id;
BEGIN
    -- Forzar recalculo usando la función existente (reutilizando la lógica de pagos)
    PERFORM trigger_pagos(); -- Esto no ejecutará nada directamente, así que mejor recalculamos a mano:
    
    UPDATE facturas f
    SET 
        balance_restante = (
            f.monto_total - COALESCE((
                SELECT SUM(p.monto)
                FROM pagos p
                JOIN estados_pago ep ON p.estado_pago_id = ep.id
                WHERE p.factura_id = f.id
                  AND ep.nombre = 'Completado'
            ), 0)
        ),
        estado_factura_id = CASE
            WHEN (
                SELECT COALESCE(SUM(p.monto), 0)
                FROM pagos p
                WHERE p.factura_id = f.id
                  AND p.estado_pago_id IN (
                      SELECT id FROM estados_pago WHERE nombre IN ('En Proceso', 'Completado')
                  )
            ) = 0 THEN (SELECT id FROM estados_factura WHERE nombre='Pendiente')
            WHEN (
                SELECT COALESCE(SUM(p.monto), 0)
                FROM pagos p
                WHERE p.factura_id = f.id
                  AND p.estado_pago_id IN (
                      SELECT id FROM estados_pago WHERE nombre IN ('En Proceso', 'Completado')
                  )
            ) < f.monto_total THEN (SELECT id FROM estados_factura WHERE nombre='En Proceso')
            WHEN (
                SELECT COALESCE(SUM(p.monto), 0)
                FROM pagos p
                WHERE p.factura_id = f.id
                  AND p.estado_pago_id IN (
                      SELECT id FROM estados_pago WHERE nombre='Completado'
                  )
            ) >= f.monto_total THEN (SELECT id FROM estados_factura WHERE nombre='Pagado')
            ELSE (SELECT id FROM estados_factura WHERE nombre='Pendiente')
        END
    WHERE id = fid;

    RETURN NEW;
END;
$$;


