CREATE FUNCTION public.trigger_pagos() RETURNS trigger
    LANGUAGE plpgsql
    AS $$
DECLARE
    fid INT;
    monto_factura NUMERIC(10,2);
    suma_completados NUMERIC(10,2);
    suma_total_en_proceso NUMERIC(10,2);
BEGIN
    -- Determinar la factura afectada
    IF TG_OP = 'DELETE' THEN
        fid := OLD.factura_id;
    ELSE
        fid := NEW.factura_id;
    END IF;

    -- Obtener monto total de la factura
    SELECT monto_total INTO monto_factura FROM facturas WHERE id = fid;

    -- ========================================
    -- 1️⃣ Prevenir sobrepago antes de INSERT o UPDATE
    -- ========================================
    IF TG_OP IN ('INSERT', 'UPDATE') THEN
        SELECT COALESCE(SUM(p.monto),0)
        INTO suma_total_en_proceso
        FROM pagos p
        JOIN estados_pago ep ON p.estado_pago_id = ep.id
        WHERE p.factura_id = fid
          AND ep.nombre IN ('En Proceso','Completado')
          AND (TG_OP='UPDATE' AND p.id <> NEW.id);

        IF (TG_OP='INSERT' AND (suma_total_en_proceso) > monto_factura) THEN
            RAISE EXCEPTION 'No se puede insertar el pago. La suma total (%.2f) excede el monto de la factura (%.2f).',
                (suma_total_en_proceso), monto_factura;
        ELSIF (TG_OP='UPDATE' AND (suma_total_en_proceso) > monto_factura) THEN
            RAISE EXCEPTION 'No se puede actualizar el pago. La suma total (%.2f) excede el monto de la factura (%.2f).',
                (suma_total_en_proceso), monto_factura;
        END IF;
    END IF;

    -- ========================================
    -- 2️⃣ Recalcular balance y estado de la factura
    -- ========================================
    SELECT COALESCE(SUM(p.monto),0)
    INTO suma_completados
    FROM pagos p
    JOIN estados_pago ep ON p.estado_pago_id = ep.id
    WHERE p.factura_id = fid
      AND ep.nombre = 'Completado';

    SELECT COALESCE(SUM(p.monto),0)
    INTO suma_total_en_proceso
    FROM pagos p
    JOIN estados_pago ep ON p.estado_pago_id = ep.id
    WHERE p.factura_id = fid
      AND ep.nombre IN ('En Proceso','Completado');

    UPDATE facturas
    SET balance_restante = (monto_total - suma_completados),
        estado_factura_id = CASE
            WHEN suma_total_en_proceso = 0 THEN (SELECT id FROM estados_factura WHERE nombre='Pendiente')
            WHEN suma_completados >= monto_factura THEN (SELECT id FROM estados_factura WHERE nombre='Pagado')
            ELSE (SELECT id FROM estados_factura WHERE nombre='En Proceso')
        END
    WHERE id = fid;

    RETURN NEW;
END;
$$;


